    /**
     * 读取csv文件
     *
     * @param filePath 文件路径
     * @param headers  csv列头
     * @return CSVRecord 列表
     * @throws IOException
     **/
    public static List<CSVRecord> readCSV(String filePath, String[] headers) {
        List<CSVRecord> records = null;
        try {
            //创建CSVFormat
            CSVFormat formator = CSVFormat.DEFAULT.withHeader(headers).withQuote(null).withSkipHeaderRecord();
            InputStreamReader in = new InputStreamReader(new FileInputStream(filePath), "gbk");
            //创建CSVParser对象
            CSVParser parser = new CSVParser(in, formator);
            records = parser.getRecords();
            parser.close();
            in.close();
        } catch (IOException e) {
            e.printStackTrace();
        }
        return records;
    }

    public static void writeCsv(String[] headers, List<List<String>> data, String filePath) {
        CSVFormat format = CSVFormat.DEFAULT.withHeader(headers);
        try {
            FileWriter fileWriter = new FileWriter(filePath);
            CSVPrinter printer = new CSVPrinter(fileWriter, format);
            for (List<String> list : data) {
                printer.printRecord(list);
            }
            fileWriter.close();
            printer.close();
        } catch (IOException e) {
            e.printStackTrace();
        }
    }

